    render(){
        return(
            <Fragment>
                    <input className='input input-city' type="text" placeholder='City...' />
                    <input className='input input-country' type="text" placeholder='Country...' />
                    <div>
                        <button>Get Weather</button>
                    </div>
                    </Fragment>
        )
    }

}


export default CityInput
